import React from "react";

export default function Practice() {
  const [count, setCount] = React.useState(0);

  const add = () => setCount(prev => prev + 1);
  const subtract = () => setCount(prev => prev - 1);
  return (
    <div style={{ display: 'flex', position: 'relative', justifyContent: 'center', alignItems: 'center', marginTop: '40px' }}>
      <button style={{ background: 'grey', borderRadius: '100px', height: '50px', width: '50px', marginRight: '90px', marginTop: '50px', position: 'absolute', color: 'white', border: 'none', fontSize: '15px' }} onClick={ subtract }>-</button>
      <div style={{ background: 'white', display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100px', width: '100px', borderRadius: '100px' }}>
        <h1>{ count }</h1>
      </div>
      <button style={{ background: 'grey', borderRadius: '100px', height: '50px', width: '50px', marginLeft: '100px', marginTop: '50px', position: 'absolute', border: 'none', color: 'white', fontSize: '15px' }}>+</button>
    </div>
  );
};
